INSERT INTO `faq` VALUES (1,'hi','hello','deleted','2024-04-16 14:08:29','2024-04-16 14:09:17'),(2,'date','this','deleted','2024-04-16 14:10:32','2024-04-16 14:12:03'),(3,'new\r\n','old','deleted','2024-04-16 14:22:34','2024-04-16 14:22:56'),(4,'How do I place an order?','Answer: To place an order, browse our menu items on the homepage, select your preferred dishes, and add them to your cart. Once you have everything you need, proceed to checkout, confirm your delivery address, choose a payment method, and place your order.','answered','2024-04-18 12:36:09','2024-04-18 12:38:16'),(5,'What are the delivery charges?','Answer: Delivery charges may vary based on your location and the total amount of your order. For orders above a certain value, delivery may be free. Please check the final page during checkout to see the applicable delivery charges.','answered','2024-04-18 12:39:05','2024-04-18 12:39:21'),(6,'How long does delivery take?\r\n\r\n','Answer: Typically, delivery takes between 30 to 60 minutes. However, times may vary based on traffic, weather conditions, and the distance from the restaurant to your delivery address.','answered','2024-04-18 12:39:32','2024-04-18 12:40:55'),(7,'Can I track my order?\r\n\r\n','Answer: Yes, once your order has been placed, you can track its status in the \'Orders\' section of your account. We will also send you updates via SMS or email.','answered','2024-04-18 12:39:39','2024-04-18 12:41:08'),(8,'What payment methods are accepted?\r\n\r\n','Answer: We accept various payment methods including credit cards, debit cards, PayPal, and cash on delivery. Some locations may support mobile payment options as well.','answered','2024-04-18 12:39:48','2024-04-18 12:41:21'),(9,'What should I do if my order is late?\r\n\r\n','Answer: If your order is late, please check the order tracking for any updates. If there are no satisfactory updates, contact our customer service for assistance.','answered','2024-04-18 12:39:56','2024-04-18 12:41:32'),(10,'Can I change or cancel my order after it\'s been placed?\r\n\r\n','Answer: You can change or cancel your order within a short window after placing it. Please use the \'Modify Order\' or \'Cancel Order\' options in your account or contact customer support immediately.','answered','2024-04-18 12:40:03','2024-04-18 12:41:44'),(11,'What if I received the wrong order?\r\n\r\n','Answer: If you receive an order that is not yours, please contact customer service immediately. We will arrange to have the incorrect order picked up and ensure the correct order is delivered to you as quickly as possible.','answered','2024-04-18 12:40:11','2024-04-18 12:41:55'),(12,'Do you offer food that caters to specific dietary requirements?\r\n\r\n','Answer: Yes, we offer a variety of food options including vegetarian, vegan, gluten-free, and halal. Please use the filters on our menu page to find dishes that meet your dietary needs.','answered','2024-04-18 12:40:19','2024-04-18 12:42:09'),(13,'How do I report a problem with my order?\r\n\r\n','Answer: If there is a problem with your order, such as missing items or poor food quality, please contact customer service through our app or website. Provide details of your order and the issue, and we will resolve it as quickly as possible.','answered','2024-04-18 12:40:27','2024-04-18 12:42:22'),(14,'How long does delivery take?',NULL,'deleted','2024-04-18 12:44:25',NULL),(15,'what is the cheapest food in catagory','coke','answered','2024-04-26 12:38:19','2024-04-26 12:38:51');
