INSERT INTO `products` VALUES (5,12,'Chow mein','Chow mein is a dish of Chinese stir-fried noodles with vegetables and sometimes meat or tofu. Over the centuries, variations of chǎomiàn were developed in many regions of China; there are several methods of frying the noodles and a range of toppings can be used.',70.00,'data:image/jpeg;base64,',0.0),(6,9,'veg biryani','Biryani is a mixed rice dish, mainly popular in South Asia. It is made with rice, some type of meat and spices. To cater to vegetarians, in some cases, it is prepared by substituting vegetables for the meat. Sometimes eggs and/or potatoes are also added.',200.00,'data:image/jpeg;base64,',0.0),(7,10,'chicken biryani','Biryani is a celebration of exotic flavors, vibrant colors and pleasing aromas infused into a pot of goodness. So this vegetarian dish is a perfect & hearty dinner packed with fragrant rice, vegetables, crunchy nuts, aromatic spices and herbs and chicken.',250.00,'data:image/jpeg;base64,',0.0),(8,9,'Panipuri','Pani puri is a deep-fried breaded hollow spherical shell, about an inch in diameter, filled with a combination of finely diced potato, onion, peas and chickpea. It is a common street food in the Indian subcontinent. It is often spiced with tamarind chutney, chili powder, or chaat masala.',50.00,'data:image/jpeg;base64,',0.0),(9,11,'Chaat','Chaat, or chāt is a family of savoury snacks that originated in India, typically served as an hors d\'oeuvre or at roadside tracks from stalls or food carts across South Asia in India, Pakistan, Nepal and Bangladesh. With its origins in Uttar Pradesh, India, chaat has become immensely popular in the rest of South Asia.',85.00,'data:image/jpeg;base64,',0.0),(10,11,'Rice meal','Served with plain rice, veg biryani , dal fry, paneer butter masala, mixed vegetables fry, raita, brown rasagula, salad, and roti -2 pieces',198.00,'https://media-assets.swiggy.com/swiggy/image/upload/fl_lossy,f_auto,q_auto,w_1024/19937a8d3981fdca2430a982fea32220',0.0),(11,11,'French Fries','Deep-fried potato wedges, best had with some tangy tomato ketchup.\r\n\r\n',90.00,'https://media-assets.swiggy.com/swiggy/image/upload/fl_lossy,f_auto,q_auto,w_1024/aaaddyk307wny1uktaby',0.0),(12,11,'Fried rice','Fried rice is a dish of cooked rice that has been stir-fried in a wok or a frying pan and is usually mixed with other ingredients such as eggs, vegetables, seafood, or meat. It is often eaten by itself or as an accompaniment to another dish.',150.00,'data:image/jpeg;base64,',0.0),(13,11,'Crispy Chicken Burger [Large]','Super crispy deep fried marinated chicken with 2types of mayo and some veggies inside of sliced burger bun.\r\n\r\n',249.00,'https://media-assets.swiggy.com/swiggy/image/upload/fl_lossy,f_auto,q_auto,w_1024/FOOD_CATALOG/IMAGES/CMS/2024/4/8/5209ac60-4705-4723-b132-6e66c2c0ee63_d8f16cd3-2683-4550-8e03-23534b84c7eb.jpg',0.0),(14,11,'Paneer roll','Rumali rotis rolled with squelchy paneer.\r\n\r\n',95.00,'https://media-assets.swiggy.com/swiggy/image/upload/fl_lossy,f_auto,q_auto,w_1024/a08ddc178100cf24825cb412eb8db662',0.0),(15,11,'coke','Pemberton\'s recipe contained cocaine in the form of an extract of the coca leaf, which inspired the “Coca” part of the beverage\'s name. The “Cola” comes from the kola nut (which contains caffeine, another stimulant). When Coca-Cola was invented, cocaine was legal and a common ingredient in medicines.',25.00,'data:image/jpeg;base64,',0.0),(16,11,'Sprite Soft Drink - Refreshing, 750 ml Pet Bottle','Refreshing people since 1999, Sprite is known for its straightforward attitude. The brand strongly believes in removing all the unnecessary Bakwaas from your life so that you can chill for real. Days full of work pressure, frustration and scoffing can make life stressful. Release all the stress with Sprite soft drink and restart with a clear head. A chilled Sprite is all it takes to reset, refresh and break the monotony of everyday life. Be it summers or winters, the crisp, cool and refreshing taste of Sprite cold drink will quench your thirst, leaving you feeling refreshed. There are just three simple steps to clear your head- Grab your Sprite, open your Sprite, drink your Sprite!\r\n\r\nStorage Instructions: Store in a cool & dry place, away from direct sunlight.',37.00,'data:image/jpeg;base64,',0.0),(17,2,'Mojito','Mojito is a traditional Cuban punch. The cocktail often consists of five ingredients: white rum, sugar, lime juice, soda water, and mint. Its combination of sweetness, citrus, and herbaceous mint flavors is intended to complement the rum, and has made the mojito a popular summer drink. ',70.00,'data:image/jpeg;base64,',0.0),(18,2,'Chai Tea Latte','Black tea infused with cinnamon, clove, and other warming spices are combined with milk for the perfect balance of sweet and spicy. Energy - Hot - Short (237ml) - 169.84 kcal / Tall (354ml) - 203 kcal / Grande (473ml) - 305.07 kcal / Venti (591ml) 385.27 kcal. Allergen - Contains Milk. An average active adult requires 2000 kcal energy per day, however, calorie needs may vary.',260.00,'https://media-assets.swiggy.com/swiggy/image/upload/fl_lossy,f_auto,q_auto,w_1024/fa43c02ef546cb60eb92c03de562d52d',0.0),(20,12,'Chole Bhature','2 pieces',155.00,'https://media-assets.swiggy.com/swiggy/image/upload/fl_lossy,f_auto,q_auto,h_600/ga8c8wyusw3nqmaztmkf',0.0),(21,12,'Sambar Vada (2 Pcs)','Serves 1 | \"crispy, fluffy and delicious vada that goes very well with coconut chutney or sambar. These doughnuts shaped fritters are made with black gram, herbs, coconut and spices',70.00,'https://media-assets.swiggy.com/swiggy/image/upload/fl_lossy,f_auto,q_auto,h_600/yviyqpjtcek0kffp8pf4',0.0);
